        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](11, " The number of media sources available to Americans has exploded over the past two decades with the growth of the internet. These myriad sources present the very same event in often dramatically different ways, which can be fascinating. The problem is, each source often labels all other sources as deceptive or even malicious by denouncing them as \u201Cfake news.\u201D ");
