        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](89, "p");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](90, " The legacy media channels, from FOX to CNN to NPR, serve the type of news they think should be sufficient for all of us: a sprinkling of hard news on top of scandals, soundbites from pundits with uniform viewpoints, \u201Cinfotainment\u201D with little news content, \u201Chot takes\u201D from celebrities, and one-sided analysis of events that are presented primarily to cause outrage. What news this coverage provides consists almost exclusively of what I label ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](91, "strong", 8);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](92, "party politics, ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](93, "contributing news from only two of the media food groups. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](94, "p");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](95, " But worse than the shallowness of each channel\u2019s analysis is the narrowness of each channel\u2019s perspective, and the implication that its narrow perspective isn\u2019t only valid but is");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](96, "em");
