        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](98, " valid perspective. Again, the label of \u201Cfake news\u201D is peppered explicitly and implicitly throughout this type of media coverage these days to disparage other sources and to demand that we view their opinion about what is important and their version of events as");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](99, "em");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](100, " the truth");
