        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](101, ", and everything else as biased, manipulated, or simply \u201Cfake.\u201D ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](102, "h2");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](103, "Third, The Remedy");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](104, "p", 1);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](105, " With food, any diet consisting of just one single food repeated over and over will lead to disease. Similarly, any one news media source consumed exclusively becomes disinformation. Even spending a little more time to watch two channels of the same food group provides a broader perspective on things, but given the media consolidation mentioned above that transpired over the last half century, even this effort inevitably leaves one with a narrow view of the world. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](106, "p");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](107, " To get something approaching a complete sense of our world today, we have to explore independent media as well as corporate media, left-leaning media as well as right-leaning media, foreign news sources and domestic government propaganda, corporate PR and \u201Cnative advertising,\u201D and delve at least occasionally into deeper systemic analysis of our political system. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](108, "p");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](109, " Reading broadly and discerning the truth from such a cornucopia of voices might sound like an impossible task, but from my experience a carefully chosen, balanced diet can be not only manageable but also fascinating and invigorating to our minds. I propose that a broad diet confers intellectual vitality as well as a more accurate sense of what is going on in one\u2019s community, country, and world \u2014 and that it ultimately paves a path to a healthy political discourse for us all. ");
