        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](112, "p", 1);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](113, " It doesn\u2019t take an exhaustive review of history to find cases where great tragedies have befallen nations when the majority of the people have been continuously deceived by a single group of media sources. The Iraq War, which killed over a million innocent people and cost trillions of dollars, is one very recent such case. The Nazi holocaust is another. Tiananmen Square. The list goes on. Rising to the mental challenge of reading diverse media sources is, I believe, a worthwhile endeavor. ");
