        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](116, "p");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](117, " I\u2019ve been writing about American politics since 2003, when I started an online political news magazine. The magazine\u2019s second issue was titled \u201CBig Media,\u201D and it specifically covered our nation\u2019s dwindling number of large news sources and the ongoing consolidation that the internet was just beginning to counteract. I\u2019ve been tracking independent and corporate news sources ever since, and I\u2019ve learned that nearly every news source has something to offer. ");
